import React from 'react';
import planeGIF from '../assets/img/planegif.gif'; // Replace with the path to your image

const ParallaxAirplane = () => {
    return (
        <div style={{ position: 'fixed', top: '50%', left: '50%', transform: 'translate(-50%, -50%)', zIndex: 1 }}>
            <img src={planeGIF} alt="Airplane" style={{ width: '30%', maxWidth: '500px' }} />
        </div>
    );
};

export default ParallaxAirplane;
